"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Newborn necrotizing enterocolitis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/newborn-necrotizing-enterocolitis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H14080464\">",
"      <span class=\"h1\">",
"       What is newborn necrotizing enterocolitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Newborn necrotizing enterocolitis (also called &ldquo;NEC&rdquo;) is a condition that happens when there is a serious injury to a baby&rsquo;s intestines. NEC can happen in all newborn babies, but is most common in premature babies.",
"     </p>",
"     <p>",
"      NEC is a serious disease. A baby who has it needs treatment as soon as possible. This is because the injury can destroy parts of the intestine. This damage can be permanent. In some very sick babies, it can even cause death. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14080479\">",
"      <span class=\"h1\">",
"       What are the symptoms of newborn necrotizing enterocolitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms usually happen 10 days to a few weeks after birth. They can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeding problems &ndash; Babies who get NEC are often in the hospital being fed through a tube. Feeding problems can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Diarrhea",
"       </li>",
"       <li>",
"        Milk or formula that stays in the stomach, instead of going into the intestines the way it should &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bleeding from the rectum",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some symptoms of NEC can also happen with other conditions. These symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Long pauses with no breathing",
"       </li>",
"       <li>",
"        Acting sleepy a lot of the time &ndash; It can be hard to wake the baby up.",
"       </li>",
"       <li>",
"        Skin that feels too warm or too cool",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors usually find NEC in babies who are already in the hospital. This is because NEC usually happens in premature babies or sick babies who are born on time. If the doctors and nurses taking care of your baby think he or she might have NEC, they can do an exam and treat the condition.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14080494\">",
"      <span class=\"h1\">",
"       Will my baby need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Doctors can order some or all of these tests:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        X-ray of the belly",
"       </li>",
"       <li>",
"        Ultrasound of the belly &ndash; An ultrasound is an imaging test that uses sound waves to create a picture of the inside of the body.",
"       </li>",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Tests on a sample of the baby&rsquo;s bowel movement",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Imaging tests such as X-ray and ultrasound show changes in the intestines caused by NEC. Blood tests and tests on a sample of bowel movement help doctors tell if NEC is causing the symptoms or if a different condition might be the cause. Other diseases can cause symptoms like those of NEC. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14080508\">",
"      <span class=\"h1\">",
"       How is necrotizing enterocolitis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A baby with NEC needs treatment right away. Treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Giving fluids and nutrition through an &ldquo;IV&rdquo; (a small tube that goes into a vein)",
"       </li>",
"       <li>",
"        Putting a thin tube called a &ldquo;nasogastric tube&rdquo; in the baby&rsquo;s nose, down the esophagus, and into the stomach. (The esophagus is the tube that carries food to the stomach.) If there is extra fluid and air in the stomach or intestines, the tube can suck it up. This can relieve belly swelling and help stop vomiting.",
"       </li>",
"       <li>",
"        Giving medicines or blood transfusions to help bleeding problems or other problems -- During a blood transfusion, the baby will get blood that has been donated by someone else. The donated blood goes into a vein.",
"       </li>",
"       <li>",
"        Antibiotics to fight infection",
"       </li>",
"       <li>",
"        Surgery &ndash; Doctors can drain fluid from the belly or take out a part of the intestine that has serious damage. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Babies with NEC can be very sick. During treatment, they might need:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Medicines to help the heart work correctly",
"       </li>",
"       <li>",
"        A breathing machine or oxygen to help them get enough air in the lungs",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Babies getting treatment for NEC have X-rays, blood tests, and tests on a sample of bowel movement often. All these tests can show if the NEC is getting better or worse.",
"     </p>",
"    </div>",
