"    </div>",
"    <div class=\"reference\">",
"     Modified from: Soll AH, Berglindh T. Receptors regulating acid secretory function. In: Physiology of the Gastrointestinal Tract, volume 1, Johnson LR, Christensen MJ, Jackson ED, et al (Eds), Raven Press, New York 1994. p.11.",
"    </div>",
